import React from 'react';
import '../Styles.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function About(){
  return (
    <div>
        <h1>Welcome to the Fattore Portfolio Manager</h1>
        <p>This website is designed to aid the passive investor.
            If you are new to the website I would recommend reaching the investing basics page.
            NOTE: This is not financial advice and should be seen as entertainment.</p>
    </div>
      );
}

export default About;
